    </p>
    <p>
      &#23545;&#20110;IO&#23494;&#38598;&#22411;&#65292;&#21017;&#30456;&#23545;&#35774;&#32622;&#20250;&#22823;&#20123;&#65292;core-count*8?...&#26377;&#20844;&#24335;&#20294;&#19981;&#35265;&#24471;&#26159;&#23545;&#30340;&#65292;&#26377;&#26102;&#20505;&#35774;&#32622;&#22823;&#26377;&#29992;&#21834;&#12290;&#20844;&#24335;&#22914;&#19979;
    </p>
    <p>
      
    </p>
    <ul>
      <li>
        <font color="rgb(0, 0, 0)" face="Helvetica, Tahoma, Arial, sans-serif">Ncpu = number of CPUs&#160;&#160;&#27604;&#22914;&#65292;&#25105;&#20204;&#30340;4&#26680;&#12290;<br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" /><br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" />Ucpu = target CPU utilization, 0 &lt;= Ucpu &lt;= 1&#160;&#160;&#65292;cpu&#20351;&#29992;&#29575;&#19968;&#33324;&#35774;&#23450;&#20026;0.6&#65292;&#21363;60%&#30340;&#36127;&#36733;<br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" /><br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" /><br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" />&#160;W/C=&#160;&#160;ratio of wait time to compute time&#160;&#160;,&#31561;&#24453;&#26102;&#38388;&#19982;&#22788;&#29702;&#26102;&#38388;&#30340;&#27604;&#29575;&#65311;<br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" /><br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" /><br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" />&#35201;&#20351;&#22788;&#29702;&#22120;&#36798;&#21040;&#26399;&#26395;&#30340;&#21033;&#29992;&#29575;,&#32447;&#31243;&#27744;&#30340;&#26368;&#20248;&#22823;&#23567;&#20026;:&#160;<br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" /><br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" /></font><font color="#6666ff" face="Helvetica, Tahoma, Arial, sans-serif"><b>Nthreads = Ncpu * Ucpu * (1 + W/C)&#160;</b></font><font color="rgb(0, 0, 0)" face="Helvetica, Tahoma, Arial, sans-serif"><br align="left" style="letter-spacing: normal; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; background-color: rgb(255, 255, 255)" />&#27604;&#22914;&#65306;4*0.6*(1+1/0.1)=26...&#21363;&#31934;&#30830;&#20272;&#31639;W/C&#26159;&#20851;&#38190;&#65292;&#27604;&#22914;&#22788;&#29702;&#26102;&#38388;&#24456;&#30701;&#65292;&#31561;&#24453;&#26102;&#38388;&#24456;&#38271;&#23601;&#35201;&#37197;&#32622;&#26356;&#22810;&#30340;&#32447;&#31243;&#25968;&#12290;linux&#19968;&#33324;&#22266;&#23450;1/100 cpu&#26102;&#38388;&#29992;&#20110;&#31561;&#24453;&#65292;&#21363;W&#20540;&#22266;&#23450;&#65292;&#25105;&#20204;&#21482;&#35201;&#30693;&#36947;C&#21363;&#21487;&#12290;</font>
      </li>
    </ul>
    <p>
      &#160;&#160;&#160;&#160;&#160;&#160;&#160; <b><font color="#009900">W/C&#30340;&#20540;&#25454;&#35828;&#21487;&#36890;&#36807;visualvm&#30475;&#21040;&#65292;&#37027;&#22826;&#22909;&#20102;</font></b>
    </p>
